import { Link } from "react-router-dom";
import Header from "./Header";


function Login(){
    return (
        <div>
            <Header/>
            welcome to login
            <br />
            USERNAME
            <input type="text" />
            <br />
            PASSWORD
            <input type="text" />
            <br />
            <button>Login</button>
            <Link to="/signup">SINGUP</Link>
        </div>
    )
}

export default Login;
